import React from "react";
import { makeStyles, withStyles } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'
import Box from '@material-ui/core/Box'
import Autocomplete from '@material-ui/lab/Autocomplete'
import TextField from '@material-ui/core/TextField'
import { CSVReader } from 'react-papaparse'
import data from '../assets/crypto_data_4_24_21.csv'

const useStyles = makeStyles((theme) => ({
    logo: {
      marginLeft: theme.spacing(15)
    },
    body: {
      padding: theme.spacing(10),
      paddingLeft: theme.spacing(75),
      paddingRight: theme.spacing(75)
    },
    form: {
      backgroundColor: 'white',
      padding: theme.spacing(5),
      borderRadius: 5,
      boxShadow: '0px 0px 10px 3px rgba(0, 0, 0, .3)',
    },
    submit: {
        justifyContent: 'center',
        alignItems: 'center',
        display: 'flex',
        flex: 1,
    }
  }))

  const BootstrapButton = withStyles({
    root: {
      color: 'white',
      boxShadow: 'none',
      textTransform: 'none',
      fontSize: 14,
      padding: '6px 200px',
      border: '1px solid',
      lineHeight: 1.5,
      backgroundColor: '#1652F0',
      borderColor: '#0063cc',
      fontFamily: 'Red Hat Display',
      '&:hover': {
        backgroundColor: '#0069d9',
        borderColor: '#0062cc',
        boxShadow: 'none',
      },
      '&:active': {
        boxShadow: 'none',
        backgroundColor: '#0062cc',
        borderColor: '#005cbf',
      },
      '&:focus': {
        boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
      },
    },
  })(Button);

  function csvJSON(csv){
    var lines=csv.split("\n");
    var result = [];
    var headers=lines[0].split(",")

    for(var i=1;i<lines.length;i++) {
        var obj = {};
        var currentline=lines[i].split(",");
        for(var j=0;j<headers.length;j++){
            obj[headers[j]] = currentline[j]
        }
        result.push(obj)
    }
    console.log(JSON.stringify(result))
    return JSON.stringify(result)
}


const InputForm = () => {
    coinData = []
    useEffect(() => {
        coinData = csvJSON(data)
      }, [])

    const coinData = csvJSON(data)
    console.log(coinData)
    console.log('here')
    const classes = useStyles()
    return (
        <form className={classes.form}>
            <Autocomplete
                id="combo-box-demo"
                options={coinData}
                getOptionLabel={(option) => option.Coins}
                style={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Combo box" variant="outlined" />}
            />
            <Box className={classes.submit}>
                <BootstrapButton>
                    SUBMIT
                </BootstrapButton>
            </Box>
        </form>
    );
}

export default InputForm
